import React from 'react';
//import footp.jpeg from '../assets';

function Navbar() {

  return (
    <div>

    <img src="logo.png" alt="Carbon Zero Logo" className="logo"></img>

    <ul className="navbar">
        <li>Rewards</li>
        <li>Questionaire</li>
        <li>Become a member</li>
        <li>Sign in</li>
    </ul>    

    </div>
  )
}

export default Navbar
